import React from "react";
const Home = () => {
  return (
    <>
      <section id="header" className="">
        <div className="container-fluid nav_bg">
          <div className="row">
            <div className="col-10 mx-auto">
              <div className="col-md-6 pt-lg-0 order-lg-1">
                <h1>Grow Your Business With <strong>Harsh rathod</strong></h1>
                <h2 className="my-3">We Are The Team Of The Talanted Deveelop</h2>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>);
}
export default Home;
